import React from 'react';

const About = () => {
  return (
    <div className="about-page">
      <h1>About Me</h1>
      <p>My Story
I'm a passionate developer with over 5 years of experience creating web applications that solve real-world problems. My journey began with curiosity about how websites work, and it has evolved into a deep love for crafting user experiences. </p>
<p>I specialize in modern web technologies and enjoy working on projects that challenge me to learn and grow. When I'm not coding, you can find me exploring new technologies, contributing to open-source projects, or mentoring other developers.</p>

    </div>
  );
};

export default About;
